(2989, '1653', '<p>ISSUE :- System Optimization and pop ups</p>\r\n\r\n<p>Call Transferred from :- Ruchika</p>\r\n\r\n<p>**********************************************************************</p>\r\n\r\n<p>Troubleshooting Steps:-&nbsp;</p>\r\n\r\n<p>~~~&gt;Took remote</p>\r\n\r\n<p>~~~&gt;Run disk utility</p>\r\n\r\n<p>~~~&gt;Verify the Disk</p>\r\n\r\n<p>~~~&gt;Run Ccleaner</p>\r\n\r\n<p>~~~&gt;Check the Login Items</p>\r\n\r\n<p>~~~&gt;Install Adblock plus on all the browsers</p>\r\n\r\n<p>~~~&gt;Install Sophos</p>\r\n\r\n<p>~~~&gt;Update the Sophos</p>\r\n\r\n<p>~~~&gt;Turn off the live protection in sophos</p>\r\n\r\n<p>~~~&gt;Turn off the web protection</p>\r\n\r\n<p>~~~&gt;Check dont restore the window for every program</p>\r\n\r\n<p>~~~&gt;Turn on the firewall</p>\r\n\r\n<p>~~~&gt;And Enable Stealth mode</p>\r\n\r\n<p>~~~&gt;Clear all the data from safari</p>\r\n\r\n<p>~~~&gt;Remove all .dmg files</p>\r\n\r\n<p>~~~&gt;Change the settings for threat cleaning in sophos</p>\r\n\r\n<p>~~~&gt;Enable block pop ups</p>\r\n\r\n<p>~~~&gt;Case Closed</p>\r\n', '2015-01-20 04:14:38', '4'),
