(2998, '561', '<p>ISSUE :- Operating System Not Found</p>\r\n\r\n<p>Product :- HP Desktop</p>\r\n\r\n<p>Call Transferred from :- Vishal</p>\r\n\r\n<p>**********************************************************************</p>\r\n\r\n<p>Troubleshooting Steps:-&nbsp;</p>\r\n\r\n<p>~~~&gt;Takeover the call</p>\r\n\r\n<p>~~~&gt;Check when stop working (After power outage)</p>\r\n\r\n<p>~~~&gt;Try to do the power reset</p>\r\n\r\n<p>~~~&gt;But not worked</p>\r\n\r\n<p>~~~&gt;So try to go to safe mode with F8 key but same error operating system not found</p>\r\n\r\n<p>~~~&gt;Try with F10 to check the&nbsp;<strong>Hard Drive Self Test<font color="#000000" face="hpsimplified, hpsimplified latin, arial, sans-serif"><span style="font-size:16px; line-height:25.6000003814697px">&nbsp;<span style="font-size:12px">but same error message</span></span></font></strong></p>\r\n\r\n<p>~~~&gt;So try with F5 for the BIOS but not worked&nbsp;</p>\r\n\r\n<p>~~~&gt;Refer to Hp website and check for the boot options but same error</p>\r\n\r\n<p>~~~&gt;So ask for the windows cd so that we can reinstall the windows or try to repair it</p>\r\n\r\n<p>~~~&gt;But cx do not have that</p>\r\n\r\n<p>~~~&gt;So ask cx to get it form and local shop and call back us once have the cd</p>\r\n\r\n<p>~~~&gt;Cx agreed</p>\r\n\r\n<p>~~~&gt;Case Closed for now</p>\r\n', '2015-01-20 23:09:16', '4'),
